(807, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class="rss-widget"><ul><li><a class=\'rsswidget\' href=\'http://feedproxy.google.com/~r/WordpressFrancophone/~3/3TCggFy-pd8/\'>L’élection du bureau WPFR</a> <span class="rss-date">26 janvier 2017</span><div class="rssSummary">Oyez, oyez ! Comme annoncé lors de l’assemblée générale du 8 décembre 2016, l’heure des élections a sonné. Le bureau actuellement en place voit son mandat terminé, de nouvelles élections doivent donc avoir lieu afin de le renouveler  Ces élections sont prévues pour le 24 février 2017 et nous invitons par cet article les adhérents souhaitant candidaterLire [&hellip;]</div></li></ul></div><div class="rss-widget"><p><strong>Erreur RSS&nbsp;:</strong> A feed could not be found at http://feeds.feedburner.com/wordpress-fr/RaoY. A feed with an invalid mime type may fall victim to this error, or SimplePie was unable to auto-discover it.. Use force_feed() if you are certain this URL is a real feed.</p></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Extensions populaires:</span> iThemes Security (formerly Better WP Security)&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=b06f2fd7f2&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Installer iThemes Security (formerly Better WP Security)">(Installer)</a></li></ul></div>', 'no'),
