(206, 1, '2016-07-04 07:18:10', '2016-07-04 06:18:10', '[vc_row][vc_column][vc_custom_heading text="Why Business Choose Visual Composer?" font_container="tag:h3|font_size:38|text_align:center|color:%233a3a3a|line_height:1.2" google_fonts="font_family:Montserrat%3Aregular%2C700|font_style:400%20regular%3A400%3Anormal" css=".vc_custom_1453298979959{padding-bottom: 35px !important;}"][/vc_column][/vc_row][vc_row gap="15" equal_height="yes" css=".vc_custom_1453299367133{padding-bottom: 50px !important;}"][vc_column width="1/3"][vc_single_image image="49" img_size="200x200" alignment="center" style="vc_box_circle" css_animation="top-to-bottom"][vc_custom_heading text="Paula O\'Reilly" font_container="tag:h4|font_size:22|text_align:center|color:%233a3a3a|line_height:1.2" google_fonts="font_family:Montserrat%3Aregular%2C700|font_style:400%20regular%3A400%3Anormal"][vc_column_text css=".vc_custom_1437056586937{margin-bottom: 10px !important;}"]Medium Size Business Owner[/vc_column_text][vc_column_text]My client loves how easy it is for them to manage their own site, after I set it up using Visual Composer page builder plugin for WordPress.[/vc_column_text][vc_btn title="Get in Touch" style="flat" shape="round" color="primary" align="center" link="||"][vc_single_image image="48" img_size="200x200" alignment="center" style="vc_box_circle" css_animation="top-to-bottom"][vc_custom_heading text="Anabella Thomson" font_container="tag:h4|font_size:22|text_align:center|color:%233a3a3a|line_height:1.2" google_fonts="font_family:Montserrat%3Aregular%2C700|font_style:400%20regular%3A400%3Anormal"][vc_column_text css=".vc_custom_1437056567677{margin-bottom: 10px !important;}"]Startup Business Owner[/vc_column_text][vc_column_text]This plug-in was/is one of the BEST investments Iâ€™ve ever made. One thing is certain. Code Canyon/WPBakery is on top of this gem.[/vc_column_text][vc_btn title="Get in Touch" style="flat" shape="round" color="primary" align="center" link="||"][vc_single_imag