(262, 1, '2016-07-05 19:54:00', '2016-07-05 18:54:00', '[vc_row gap="15" equal_height="yes" css=".vc_custom_1453299367133{padding-bottom: 50px !important;}"][vc_column width="1/4"][/vc_column][vc_column width="1/2"][vc_single_image image="261" img_size="full" alignment="center" style="vc_box_circle" css_animation="top-to-bottom"][vc_empty_space height="25px"][/vc_column][vc_column width="1/4"][/vc_column][/vc_row][vc_row][vc_column width="1/6"][/vc_column][vc_column width="2/3"][vc_column_text]\r\n<p style="text-align: center;">Jean-Philippe Lebée est né dans l’Oise; il a étudié l’audiovisuel, puis le cinéma pour ensuite faire de la photographie à l’école des Gobelins à Paris où il approfondit ses connaissances en la matière et perfectionne sa technique et son style. Il a su déployer son univers à travers une écriture prononcée et singulière. Dès son plus jeune âge s\'est affirmé en temps que photographe en signant avec l’agence Rossas, pour une campagne internationale, avec la marque de whisky Dewar\'s à Barcelone à l’âge de 21 ans. Durant plusieurs mois, il sillonnera une dizaine de pays à travers le monde pour photographier des personnages. Admirateur des oeuvres de Christopher Nolan et de Steven Soderbergh, Jean-Philippe s’est emparé de la photographie dite \'\'lifestyle’’, jouant de ses couleurs subtiles, et photographiant avec une légèreté déconcertante.</p>\r\n<p style="text-align: center;">Il utilise le plus souvent un moyen format mais réalise également certains travaux à l’argentique Jean-Philippe essaye à chaque fois de trouver le moment, l’instant qui rendra la photo unique. Dans un monde peuplé de femmes et d\'hommes en perpétuelle évolution, il tente de les immortaliser dans des moment de vie donnant ainsi une signature sur chacune de ses photos.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Biography', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2016-07-05 19:54:00', '2016-07-05 18:54:00', '', 30, 'http://localhost/lebee/non-classe/30-revision-v1/', 0, 'revision', '', 0),
