(321, 1, '2016-07-06 20:16:22', '2016-07-06 19:16:22', '[vc_row][vc_column width="1/2"][vc_column_text]\r\n<div class="info_contact"></div>\r\n<h3 class="grid-100">Our Address</h3>\r\n<p id="u14734-3"><span id="u14734">Représenté par Carole Lambert</span></p>\r\n<p id="u14734-7"><i class="fa fa-home" style="color: #ccaa79;"></i> 4 bis, rue de l\'Assomption, 75016 Paris</p>\r\n<p id="u14734-12"><i class="fa fa-phone" style="color: #ccaa79;"></i> +33 1 55 74 84 84</p>\r\n<p id="u14734-15"><i class="fa fa-envelope-o" style="color: #ccaa79;"></i> Jean-Philippe Lebée : contact@jeanphilippelebee.com</p>\r\n<p id="u14734-20"><i class="fa fa-envelope-o" style="color: #ccaa79;"></i> Carole Lambert : carole@carolelambert.com</p>\r\n<p id="u14734-27"><i class="fa fa-globe" style="color: #ccaa79;"></i> www.carolelambert.com</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/2"][vc_column_text]\r\n<div class="info_contact_form"></div>\r\n[contact-form-7 id="219"][/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_empty_space][/vc_column][/vc_row]', 'Contact', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2016-07-06 20:16:22', '2016-07-06 19:16:22', '', 19, 'http://localhost/lebee/non-classe/19-revision-v1/', 0, 'revision', '', 0),
(322, 1, '2016-07-06 20:16:57', '2016-07-06 19:16:57', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="2/3"][vc_column_text css=".vc_custom_1467745813152{margin-right: 30px !important;margin-left: 30px !important;border-radius: 4px !important;}"]\r\n<p style="text-align: center;">Jean-Philippe Lebée est né dans l’Oise; il a étudié l’audiovisuel, puis le cinéma pour ensuite faire de la photographie à l’école des Gobelins à Paris où il approfondit ses connaissances en la matière et perfectionne sa technique et son style. Il a su déployer son univers à travers une écriture prononcée et singulière. Dès son plus jeune âge s\'est affirmé en temps que photographe en signant avec l’agence Rossas, pour une campagne internationale, avec la marque de whisky Dewar\'s à Barcelone à l’âge de 21 ans. Durant plusieurs mois, il sillonnera une dizaine de pays à travers le monde pour photographier des personnages. Admirateur des oeuvres de Christopher Nolan et de Steven Soderbergh, Jean-Philippe s’est emparé de la photographie dite \'\'lifestyle’’, jouant de ses couleurs subtiles, et photographiant avec une légèreté déconcertante.</p>\r\n<p style="text-align: center;">Il utilise le plus souvent un moyen format mais réalise également certains travaux à l’argentique Jean-Philippe essaye à chaque fois de trouver le moment, l’instant qui rendra la photo unique. Dans un monde peuplé de femmes et d\'hommes en perpétuelle évolution, il tente de les immortaliser dans des moment de vie donnant ainsi une signature sur chacune de ses photos.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Biography', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2016-07-06 20:16:57', '2016-07-06 19:16:57', '', 30, 'http://localhost/lebee/non-classe/30-revision-v1/', 0, 'revision', '', 0),
