(334, 1, '2016-07-06 23:32:16', '2016-07-06 22:32:16', '', 'jeanphilippelebee', '', 'inherit', 'open', 'closed', '', 'jeanphilippelebee', '', '', '2016-07-06 23:32:16', '2016-07-06 22:32:16', '', 0, 'http://localhost/lebee/wp-content/uploads/2016/07/jeanphilippelebee.jpg', 0, 'attachment', 'image/jpeg', 0),
(335, 1, '2016-07-06 23:45:10', '2016-07-06 22:45:10', '[vc_row][vc_column width="1/6"][/vc_column][vc_column width="2/3"][vc_column_text css=".vc_custom_1467745813152{margin-right: 30px !important;margin-left: 30px !important;border-radius: 4px !important;}"]\r\n<p style="text-align: center;">Jean-Philippe Lebée est né dans l’Oise; il a étudié l’audiovisuel, puis le cinéma pour ensuite faire de la photographie à l’école des Gobelins à Paris où il approfondit ses connaissances en la matière et perfectionne sa technique et son style. Il a su déployer son univers à travers une écriture prononcée et singulière.</p>\r\n<p style="text-align: center;">Dès son plus jeune âge s\'est affirmé en temps que photographe en signant avec l’agence Rossas, pour une campagne internationale, avec la marque de whisky Dewar\'s à Barcelone à l’âge de 21 ans. Durant plusieurs mois, il sillonnera une dizaine de pays à travers le monde pour photographier des personnages. Admirateur des oeuvres de Christopher Nolan et de Steven Soderbergh,</p>\r\n\r\n<blockquote>\r\n<p style="text-align: center;">Jean-Philippe s’est emparé de la photographie dite \'\'lifestyle’’, jouant de ses couleurs subtiles, et photographiant avec une légèreté déconcertante.</p>\r\n</blockquote>\r\n<p style="text-align: center;">Il utilise le plus souvent un moyen format mais réalise également certains travaux à l’argentique Jean-Philippe essaye à chaque fois de trouver le moment, l’instant qui rendra la photo unique. Dans un monde peuplé de femmes et d\'hommes en perpétuelle évolution, il tente de les immortaliser dans des moment de vie donnant ainsi une signature sur chacune de ses photos.</p>\r\n[/vc_column_text][/vc_column][vc_column width="1/6"][/vc_column][/vc_row]', 'Biography', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2016-07-06 23:45:10', '2016-07-06 22:45:10', '', 30, 'http://localhost/lebee/non-classe/30-revision-v1/', 0, 'revision', '', 0),
